import React from 'react'
import './css/card.css';
import { NavLink, Route } from 'react-router-dom';

function Card(item) {

  
  return (
    <div className="side">
        <img onClick={<NavLink to="messages"/>} src={item.val} className='pic' alt="error" /> 
        <p>{item.textval} </p>
    </div>
  );
}

export default Card;
